    "Nextcloud configuration file is writable" : "Nextcloud سەپلىمە ھۆججىتىنى يېزىشقا بولىدۇ",
    "Scheduling objects table size" : "ئوبيېكت جەدۋەلنىڭ چوڭ-كىچىكلىكىنى ئورۇنلاشتۇرۇش",
